import React, { useEffect,useState } from "react";
import { BarChart, Bar, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend} from 'recharts';
import { LineChart, Line} from 'recharts';
import axios from "axios";
import Statics from "./Statics";
const Dashboard = () => {
  const [apis, setapis] = useState([]);
  const [user, setuser] = useState([]);
useEffect(()=>{
  axios
  .get(`${process.env.REACT_APP_BACKEND}/getapi`)
  .then((res) => {
    setapis(res.data);
  })
  .catch((err) => {
    console.log(err);
  });
  axios
  .get(`${process.env.REACT_APP_BACKEND}/getuser`)
  .then((res) => {
    setuser(res.data);
  })
  .catch((err) => {
    console.log(err);
  });
},[])

  const data = [
    {
      name: 'Page A',
      uv: 4000,
      pv: 2400,
      amt: 2400,
    },
    {
      name: 'Page B',
      uv: 3000,
      pv: 1398,
      amt: 2210,
    },
    {
      name: 'Page C',
      uv: 2000,
      pv: 9800,
      amt: 2290,
    },
    {
      name: 'Page D',
      uv: 2780,
      pv: 3908,
      amt: 2000,
    },
    {
      name: 'Page E',
      uv: 1890,
      pv: 4800,
      amt: 2181,
    },
    {
      name: 'Page F',
      uv: 2390,
      pv: 3800,
      amt: 2500,
    },
    {
      name: 'Page G',
      uv: 3490,
      pv: 4300,
      amt: 2100,
    },
  ];
  return (
    <>
      <Statics></Statics>
    </>
  );
};

export default Dashboard;
